import React from 'react'

const SignUp = () => {
    return(
        <div className="Template">
            <div className="SignUp-main_box">
                <input type="text" placeholder="아이디" className="idBox"/>
                <input type="text" placeholder="이름" className="nameBox"/>
                <input type="password" placeholder="비밀번호" className="passwordBox"/>
                <input type="password" placeholder="비밀번호 확인" className="passwordCheckBox"/>
            </div>
        </div>
    )
}

export default SignUp;
